import React, { useEffect, useState } from "react";
import { getAllDrinks, getMostViewed } from "../services/product.services";

export default function DebugPage() {
  const [allDrinks, setAllDrinks] = useState([]);
  const [mostViewed, setMostViewed] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadData();
  }, []);

  const loadData = async () => {
    try {
      setLoading(true);
      const [allData, mostViewedData] = await Promise.all([
        getAllDrinks(1, 100), // Lấy tất cả sản phẩm
        getMostViewed(10) // Lấy 10 sản phẩm xem nhiều nhất
      ]);
      
      setAllDrinks(allData.drinks);
      setMostViewed(mostViewedData);
    } catch (error) {
      console.error('Lỗi tải dữ liệu:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleViewProduct = async (drinkId) => {
    try {
      // Gọi API để xem chi tiết sản phẩm (sẽ tăng lượt xem)
      const response = await fetch(`http://localhost:8080/api/drinks/${drinkId}`);
      const data = await response.json();
      console.log('Đã xem sản phẩm:', data.name, 'Lượt xem:', data.views);
      
      // Reload data để xem thay đổi
      setTimeout(() => {
        loadData();
      }, 500);
    } catch (error) {
      console.error('Lỗi xem sản phẩm:', error);
    }
  };

  if (loading) {
    return (
      <div className="max-w-6xl mx-auto p-6">
        <div className="text-center py-12">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-purple-600 mx-auto"></div>
          <p className="mt-4 text-gray-600">Đang tải dữ liệu debug...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto p-6">
      <h1 className="text-3xl font-bold mb-8 text-center">Debug - Kiểm tra lượt xem</h1>
      
      <div className="mb-8">
        <button 
          onClick={loadData}
          className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg"
        >
          Làm mới dữ liệu
        </button>
      </div>

      {/* Tất cả sản phẩm với lượt xem */}
      <div className="mb-12">
        <h2 className="text-2xl font-bold mb-4">Tất cả sản phẩm (sắp xếp theo ID)</h2>
        <div className="bg-white rounded-lg shadow overflow-hidden">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">ID</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Tên</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Lượt xem</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Đã bán</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Thao tác</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {allDrinks.map((drink) => (
                <tr key={drink.id} className="hover:bg-gray-50">
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                    {drink.id}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {drink.name}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    <span className="font-bold text-blue-600">{drink.views || 0}</span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {drink.sold || 0}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    <button
                      onClick={() => handleViewProduct(drink.id)}
                      className="bg-green-600 hover:bg-green-700 text-white px-3 py-1 rounded text-sm"
                    >
                      Xem (tăng lượt xem)
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Top sản phẩm xem nhiều */}
      <div className="mb-12">
        <h2 className="text-2xl font-bold mb-4">Top sản phẩm xem nhiều nhất</h2>
        <div className="bg-white rounded-lg shadow overflow-hidden">
          <table className="min-w-full divide-y divide-gray-200">
            <thead className="bg-gray-50">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Thứ hạng</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Tên</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Lượt xem</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Đã bán</th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Thao tác</th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-gray-200">
              {mostViewed.map((drink, index) => (
                <tr key={drink.id} className="hover:bg-gray-50">
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                    <span className="bg-yellow-100 text-yellow-800 px-2 py-1 rounded-full text-xs font-bold">
                      #{index + 1}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {drink.name}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    <span className="font-bold text-red-600">{drink.views || 0}</span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {drink.sold || 0}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    <button
                      onClick={() => handleViewProduct(drink.id)}
                      className="bg-green-600 hover:bg-green-700 text-white px-3 py-1 rounded text-sm"
                    >
                      Xem (tăng lượt xem)
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4">
        <h3 className="text-lg font-semibold text-yellow-800 mb-2">Hướng dẫn kiểm tra:</h3>
        <ol className="list-decimal list-inside text-yellow-700 space-y-1">
          <li>Bấm nút "Xem (tăng lượt xem)" trên bất kỳ sản phẩm nào</li>
          <li>Quan sát số lượt xem tăng lên trong bảng "Tất cả sản phẩm"</li>
          <li>Bấm "Làm mới dữ liệu" để xem thứ tự trong "Top sản phẩm xem nhiều nhất" có thay đổi không</li>
          <li>Sản phẩm có lượt xem cao nhất sẽ lên đầu danh sách</li>
        </ol>
      </div>
    </div>
  );
}
